This species was already known from Vietnam and reported as a local BCA in earlier survey work (
Nguyen et al. 2016
) though no measurements were given. Measurements of female specimens collected during this study are given in table 1 and compared with measurements obtained from specimens collected in other countries of Asia and Islands of the Indian Ocean. Measurements match with most of the previous measurements, especially with those obtained on specimens from La Réunion Island . The setal lengths of the present females are longer than those obtained from the holotype , which are in the lower part of the range of data obtained for each seta (probably measurements were obtained from a very small size female).
